gene = ''
#alternate solutions (multiplying by x-secondnum instead of adding: {A = 1174 i sqrt(77/494283), C = (1264673 i)/(10 sqrt(38059791)), G = 337/2 i sqrt(259/146949), U = 20 i sqrt(2849/13359), X = -500 i sqrt(407/93513)})
#other alternate, frequency = first*(second+third) a=1174*sqrt(77/494283), c=1264673/(10*sqrt(38059791)), g=337*sqrt(259/146949)/2,u=20*sqrt(289/13359),x=500*sqrt(407/93513)
geneaslist = list(gene)
def codontofreq(geneaslist):
  frequencies = []
  beats = [0]
  i=0
  firstfreqnum = float(0)
  secondfreqnum = float(0)
  while i<len(geneaslist):
    if (geneaslist[i]=='A'):
      firstfreqnum=7008/13
    elif(geneaslist[i]=='T'):
      firstfreqnum=4187/13
    elif(geneaslist[i]=='C'):
      firstfreqnum=71520/91
    elif(geneaslist[i]=='G'):
      firstfreqnum=2848/13
    try:
      if (geneaslist[i+1]=='A'):
        secondfreqnum=7008*7/(32*13)
      elif(geneaslist[i+1]=='T'):
        secondfreqnum=4187*7/(32*13)
      elif(geneaslist[i+1]=='C'):
        secondfreqnum=71520/(32*13)
      elif(geneaslist[i+1]=='G'):
        secondfreqnum=2848*7/(32*13)
    except:
      print("")#pass
    frequencies.append(firstfreqnum+secondfreqnum)
    if(geneaslist[i:i+3].count('G')>1):
        beats.append(0.20)
        #frequencies.append(0)
        #beats.append(0)
    elif(geneaslist[i:i+3].count('T')>0 and geneaslist[i:i+3].count('C')>0):
        beats.append(0.2)
        #frequencies.append(0)
        #beats.append(0.08)
    else:
        beats.append(0.20)
        #frequencies.append(0)
        #beats.append(0.04)
    i+=3
  return(frequencies,beats)


print("frequencies are as follows: ",codontofreq(geneaslist))
print("second harmonic is as follows: ",codontofreq(geneaslist[1:]))
print("third harmonic is as follows: ",codontofreq(geneaslist[2:]))


# Define the frequency and duration of each tone in seconds
frequencies, durations = codontofreq(geneaslist)  #

print('frequencies: ', frequencies)

# Define the sampling rate, bit depth, and channels
sampling_rate = 44100
bit_depth = 16
channels = 1

# Calculate the total length of the audio file in samples
total_samples = int(sampling_rate * sum(durations))

# Generate the audio data as a numpy array
audio_data = np.zeros(total_samples)
current_sample = 0
for freq, dur in zip(frequencies, durations):
    samples = int(sampling_rate * dur)
    t = np.linspace(0, dur, samples, False)
    waveform = np.sin(2 * np.pi * freq * t)
    audio_data[current_sample:current_sample+samples] = waveform
    current_sample += samples

# Convert the audio data to the appropriate bit depth
if bit_depth == 8:
    audio_data = np.int8(audio_data * 127)
elif bit_depth == 16:
    audio_data = np.int16(audio_data * 32767)

# Create the .wav file
with wave.open("tone.wav", "wb") as wave_file:
    wave_file.setnchannels(channels)
    wave_file.setsampwidth(bit_depth // 8)
    wave_file.setframerate(sampling_rate)
    wave_file.writeframes(audio_data.tobytes())

